namespace WBW\Library\Core\Tests\ThirdParty\Quadratus\Attribute;

use WBW\Library\Core\Tests\AbstractTestCase;
use WBW\Library\Core\Tests\Fixtures\ThirdParty\Quadratus\Attribute\TestFloatMtPrime2ChantierTrait;

/**
 * Mt prime2 chantier trait test.
 *
 * @author webeweb <https://github.com/webeweb/>
 * @package WBW\Library\Core\Tests\ThirdParty\Quadratus\Attribute
 */
class FloatMtPrime2ChantierTraitTest extends AbstractTestCase {

    /**
     * Tests the setMtPrime2Chantier() method.
     *
     * @return void
     */
    public function testSetMtPrime2Chantier() {

        $obj = new TestFloatMtPrime2ChantierTrait();

        $obj->setMtPrime2Chantier(10.092018);
        $this->assertEquals(10.092018, $obj->getMtPrime2Chantier());
    }
}
